import React, { useRef } from 'react';
import { IonButton, IonContent, IonDatetime, IonHeader, IonInput, IonItem, IonLabel, IonPage, IonTitle, IonToolbar } from '@ionic/react';
import ExploreContainer from '../components/ExploreContainer';
import './Tab3.css';


const descInput = (document.getElementById('event-desc') as HTMLInputElement);
const addButton = document.getElementById('add-button');

const Tab3: React.FC = () => {
  const nameInput = useRef<HTMLIonInputElement>(null);

  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Rough Event Adder</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent fullscreen>
        <IonItem>
            <IonLabel position="floating">Event Title</IonLabel>
            <IonInput id="event-name"></IonInput>
        </IonItem>
        <IonItem>
            <IonLabel position="floating">Event Description</IonLabel>
            <IonInput id="event-desc"></IonInput>
        </IonItem>
        <IonItem>
            <IonLabel>Start</IonLabel>
            <IonDatetime display-format="h:mm a" picker-format="h:mm a" value="12:00"></IonDatetime>
        </IonItem>
        <IonItem>
            <IonLabel>End</IonLabel>
            <IonDatetime display-format="h:mm a" picker-format="h:mm a" value="12:00"></IonDatetime>
        </IonItem>
        <IonButton onClick={doTheThing} id="add-button">Add Event</IonButton>
        <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle size="large">Tab 3</IonTitle>
          </IonToolbar>
        </IonHeader>
      </IonContent>
    </IonPage>
  );
};

const doTheThing = () => {
  const name = nameInput.current?.value;
  console.log(name);
}

addButton?.addEventListener('click', doTheThing);

export default Tab3;
